// frontend/src/App.js
import {Route, BrowserRouter as Router , Switch} from 'react-router-dom'
import Home from './Pages/Home';
import PackagesPage from './Pages/PackagesPage';
function App() {

  return (
   <Router>
      <Route path='/'>
        <Home/>
      </Route>
      <Route path='/packages'>
        <PackagesPage/>
      </Route>
   </Router>
  );
}

export default App;
